  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Upper
  Souris National Wildlife Refuge outlines Refuge accomplishments during the 1966
  calendar year. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover conditions during the year. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, collections
  and receipts, vegetation control, and wildfires. Resource management is outlined;
  topics include grazing, haying, and commercial fishing. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, and violations. Items of interest and N-R forms are attached.\",\n\t\"owner_org\":
